package maestro.entity;public class categoria_oster implements java.io.Serializable {	private String catocodsx;	private String catodescripcion;	private String resumen;	public categoria_oster(String catocodsx, String catodescripcion, String resumen) {		this.catocodsx = catocodsx;		this.catodescripcion = catodescripcion;		this.resumen = resumen;	}	public String getcatocodsx() {		return catocodsx;	}	public void setcatocodsx(String catocodsx) {		this.catocodsx = catocodsx;	}	public String getcatodescripcion() {		return catodescripcion;	}	public void setcatodescripcion(String catodescripcion) {		this.catodescripcion = catodescripcion;	}	public String getResumen() {		return resumen;	}	public void setResumen(String resumen) {		this.resumen = resumen;	}}